// Read transactions data and analyze Celina property
const fs = require('fs');
const { execSync } = require('child_process');

// Fetch transactions
console.log('Fetching transactions data...');
const transactionsRaw = execSync('node /job/.pi/skills/graph-api/graph.js read Transactions').toString();
const transactions = JSON.parse(transactionsRaw);

// Get header row
const headers = transactions[0];
console.log('Headers:', headers);

// Filter for Celina transactions
const celinaTransactions = transactions
  .slice(1) // Skip header
  .filter(row => row[2] === 'Celina') // Property_ID column
  .map(row => ({
    date: row[0],
    checkNum: row[1],
    propertyId: row[2],
    tenant: row[3],
    type: row[4],
    amount: row[5],
    period: row[6],
    notes: row[7]
  }));

console.log('\n=== CELINA TRANSACTIONS ===');
console.log(JSON.stringify(celinaTransactions, null, 2));

// Contract details
const contractDetails = {
  propertyId: 'Celina',
  tenant: 'Christian Lachausse',
  monthlyRent: 1800,
  billingCycle: 'monthly',
  notifyDays: 3,
  contractStart: 46082, // Excel serial date
  contractEnd: 'M/M', // Month-to-month
  active: true
};

console.log('\n=== CONTRACT DETAILS ===');
console.log(JSON.stringify(contractDetails, null, 2));

// Helper function to convert Excel serial date to JS Date
function excelDateToJSDate(serial) {
  if (!serial || typeof serial !== 'number') return null;
  const utc_days = Math.floor(serial - 25569);
  const utc_value = utc_days * 86400;
  const date_info = new Date(utc_value * 1000);
  return new Date(date_info.getFullYear(), date_info.getMonth(), date_info.getDate());
}

// Current date
const today = new Date();
console.log('\n=== CURRENT DATE ===');
console.log(today.toISOString().split('T')[0]);

// Find most recent payment
let mostRecentPayment = null;
let mostRecentDate = null;

for (const txn of celinaTransactions) {
  if (txn.date && typeof txn.date === 'number') {
    const txnDate = excelDateToJSDate(txn.date);
    if (txnDate && (!mostRecentDate || txnDate > mostRecentDate)) {
      mostRecentDate = txnDate;
      mostRecentPayment = txn;
    }
  }
}

console.log('\n=== MOST RECENT PAYMENT ===');
if (mostRecentPayment) {
  console.log('Date:', mostRecentDate.toISOString().split('T')[0]);
  console.log('Amount:', mostRecentPayment.amount);
  console.log('Period:', mostRecentPayment.period);
  console.log('Type:', mostRecentPayment.type);
  console.log('Notes:', mostRecentPayment.notes);
} else {
  console.log('No payments found for Celina property');
}

// Calculate next invoice date
// For monthly billing, rent is due on the 1st of each month
// Invoice should be sent notify_days (3) before the due date
console.log('\n=== NEXT INVOICE CALCULATION ===');

// Determine the next rent period
const now = new Date();
const currentYear = now.getFullYear();
const currentMonth = now.getMonth(); // 0-indexed
const currentDay = now.getDate();

// Next rent is due on the 1st of next month
let nextRentDueDate = new Date(currentYear, currentMonth + 1, 1);

// If we're already past the invoice date for next month, calculate for the month after
const nextInvoiceDate = new Date(nextRentDueDate);
nextInvoiceDate.setDate(nextInvoiceDate.getDate() - contractDetails.notifyDays);

if (now > nextInvoiceDate) {
  // Move to the following month
  nextRentDueDate = new Date(currentYear, currentMonth + 2, 1);
  nextInvoiceDate.setMonth(nextInvoiceDate.getMonth() + 1);
  nextInvoiceDate.setDate(1 - contractDetails.notifyDays);
}

console.log('Next rent due date:', nextRentDueDate.toISOString().split('T')[0]);
console.log('Next invoice should be sent:', nextInvoiceDate.toISOString().split('T')[0]);
console.log('Days until next invoice:', Math.ceil((nextInvoiceDate - now) / (1000 * 60 * 60 * 24)));

// Summary
console.log('\n=== SUMMARY ===');
console.log(`Property: Celina`);
console.log(`Tenant: Christian Lachausse`);
console.log(`Monthly Rent: $${contractDetails.monthlyRent}`);
console.log(`Billing Cycle: ${contractDetails.billingCycle}`);
console.log(`Invoice Notification: ${contractDetails.notifyDays} days before rent is due`);
console.log(`Active Contract: ${contractDetails.active ? 'Yes' : 'No'} (${contractDetails.contractEnd})`);
console.log(`\nCurrent Date: ${now.toISOString().split('T')[0]}`);
if (mostRecentPayment) {
  console.log(`Last Payment: ${mostRecentDate.toISOString().split('T')[0]} - $${mostRecentPayment.amount} for ${mostRecentPayment.period}`);
}
console.log(`\nNext Invoice Date: ${nextInvoiceDate.toISOString().split('T')[0]}`);
console.log(`Next Rent Due Date: ${nextRentDueDate.toISOString().split('T')[0]}`);
console.log(`Days Until Next Invoice: ${Math.ceil((nextInvoiceDate - now) / (1000 * 60 * 60 * 24))}`);

